INSERT INTO `product_content` VALUES (2,'2025-06-16 23:18:39.191868','?? 超值顯卡來啦！！！??\n? GIGABYTE RTX 3080Ti GAMING OC 12G ?\n? 型號：GV-N308TGAMING OC-12GD ?\n⚡️ 原廠保養內核翻新，效能媲美全新！ ?✨\n\n? 盒裝完整、功能正常 ✅\n?️ 使用不到4個月，幾乎全新！?\n?️ 購入日期：2022/06/12\n? 當初購入價：31990元 ?\n\n?️ 原廠保固到 2027/06 ?️\n? 超強散熱，遊戲、剪片、AI 都一把罩！???\n\n? 想升級電腦效能？這張顯卡絕對是你的不二之選！?','3080ti12g-保固 2027/06比4080 10G強GV-N3080TiGAMING OC-12GD以送原廠保養','【二手】 3080TI 12G  保固 2027/06 ','2025-06-17 10:02:52.603594',2),(3,'2025-06-17 13:46:01.124651','?二手聯力240水冷來啦！?\n?ARGB燈效閃亮登場?\n?高風壓風扇?\n⚙️鋁製外殼＋磁吸上蓋⚙️\n?TCT冷頭+MCT技術?\n?多平台支援?\n?照片皆實拍?\n?高顏值又高效?\n‼️快來帶走它吧‼️','二手 聯力 240水冷 商品照片皆為實拍','二手 聯力 240水冷','2025-06-17 13:46:01.124651',3),(4,'2025-06-17 13:55:04.637766','?二手 MONTECH（君主）AIR 900 MESH BLACK?\n?經典黑配鋼化玻璃側透✨前面板金屬網孔，極致散熱?\n機殼材質：塑膠＋鋼材＋強化玻璃?\n尺寸：430 x 213 x 480mm?\n主機板支援：Mini-ITX / Micro-ATX / ATX / E-ATX ?\n硬碟安裝空間充足：2.5\"/3.5\" 共2組＋2.5\" SSD*5?\n前置I/O齊全：USB 3.0 x2、USB 2.0 x2?\n簡約外觀兼顧實用?適合裝機、升級、側透展示?\n✨照片皆實拍，有使用痕跡但功能正常?','中市 800 二手 MONTECH(君主) Air 900 MESH BLACK 機殼 鋼化玻璃  不含電源供應器',' MONTECH(君主) Air 900 MESH BLACK 機殼 鋼化玻璃','2025-06-17 13:55:04.637766',4),(5,'2025-06-17 14:08:07.057360','?Toshiba SSD 512G NVMe Gen3 x4?\n⚡M.2 2280介面，讀取高達1594MB/s?\n?寫入539MB/s，速度穩定又可靠！\n?幾乎全新✨通電僅約2～4小時，寫入低於2G\n?健康度100%，效能如新?\n❌無原廠保固，✅提供賣場15天保固（不含人為損壞）?\n若15天內無法開機或BIOS無法辨識，可更換處理?️\n?適用Intel、美光、Samsung平台皆相容?\n?高速開機、快速讀寫，升級神隊友！','Toshiba SSD 512G nvme gen3 x4 m2 m.2 intel 美光 samsung','Toshiba SSD 512G','2025-06-17 14:08:07.057360',5),(6,'2025-06-17 14:15:15.807104','?各大廠牌 400W~450W 二手電源供應器?\n?廠牌隨機出貨，如需指定＋$50元挑選\n?皆為良品，出貨前實測通過✅\n?照片皆為實物拍攝，請安心選購！\n?️售後提供7天保固，測試異常可退費或換貨?\n?特價只要 $130/顆，划算入手⚡\n♻️現場取貨歡迎攜帶報廢品：壞電腦／零件／液晶等\n?可現場折抵消費，環保又省錢?','(出清 衝評價) 保固7天 售$130元','各大廠 400W-450W 二手良品 ','2025-06-17 14:15:15.807104',6);
